import React from 'react';
import { Link } from 'react-router-dom';
import './HomePage.scss';

interface Service {
  id: string;
  name: string;
  description: string;
  image: string;
  price: number;
}

const HomePage: React.FC = () => {
  // Припустимо, що у вас є масив послуг
  const services: Service[] = [
    { id: '1', name: 'Service 1', description: 'Description 1', image: 'image1.jpg', price: 100 },
    { id: '2', name: 'Service 2', description: 'Description 2', image: 'image2.jpg', price: 200 },
    // Додайте інші послуги за потреби
  ];

  return (
    <div className="home-page">
      {/* Перший блок */}
      <section className="hero-section">
        <h1>Welcome to Our Clinic</h1>
        <p>We provide high-quality medical services</p>
      </section>

      {/* Другий блок з послугами */}
      <section className="services-section">
        <h2>Our Services</h2>
        <div className="services-grid">
          {services.map((service) => (
            <Link to={`/service/${service.id}`} key={service.id} className="service-card">
              <img src={service.image} alt={service.name} className="service-image" />
              <div className="service-content">
                <h3>{service.name}</h3>
                <p>{service.description}</p>
                <span className="price">${service.price}</span>
              </div>
            </Link>
          ))}
        </div>
      </section>
    </div>
  );
};

export default HomePage;
